This line assumes that if the `MemoryAccess` is not a `MemoryDef`, it must be a `MemoryPhi`, but this is not always true. If `InsnDefining` is `nullptr` or not a `MemoryPhi`, this will cause a crash. The sanitizer report's repeated stack trace and the assert at the end of the function confirm this.

