responded: From the code and the stack trace, the root cause is that `getNewDefiningAccessForClone` can recurse infinitely when the mapping is missing, because the fallback (`MSSA->getLiveOnEntryDef()`) is not always appropriate for a phi node, and the recursion is not guarded against cycles or missing mappings.

**Key insight:**  
- The code for the `MemoryPhi` case does not check if `MPhiMap.lookup(DefPhi)` returns a non-null value. If it does not, it leaves `InsnDefining` as the original `DefPhi`, which may not be valid in the context of the clone.
- The recursive call in the `MemoryDef` case can also recurse infinitely if the mapping is not present, as the fallback is not always a valid base case.

**Correct fix:**
- For the `MemoryPhi` case, if `MPhiMap.lookup(DefPhi)` returns `nullptr`, we should break the recursion by returning `MSSA->getLiveOnEntryDef()` (as is done for missing definitions elsewhere in MemorySSA).
- For the `MemoryDef` case, ensure that if the recursion returns `nullptr`, we also return `MSSA->getLiveOnEntryDef()`.

Let's patch both cases to break the recursion and avoid infinite loops or invalid accesses.

